import { Button, Form, Input, InputNumber } from 'antd';

function AddPatient() {

    const [form] = Form.useForm();

  return (

    <div style={{marginLeft:"80px", marginRight:"80px", border:"1px solid #B8E8FC", borderRadius:"10px", marginTop:"40px", height:"full", width:"full"}}>

        <div style={{marginLeft:"40px"}}>

        <Form
            requiredMark={"optional"}
            form={form}
            layout="vertical"
            className="bg-white pl-5 pr-5 md:pl-12 md:pr-12 pt-10 border-0"
            onFinish={saveEquipment}
            style={{ border: "1px solid #D7EAFB" }}
        >

            <Form.Item
                name={"pid"}
                label={
                    <label style={{ color: "#03488A" }}>Patient ID</label>
                }
                rules={[
                {
                    required: true,
                    message : "Please input h=this feild !"
                },
                ]}
            >
                <Input />
            </Form.Item>


        </Form>

        </div>

    </div>

  )

}

export default AddPatient
